import react from 'react';

const Select = ({ currencies, option }) => { 
    return (
        <div class="currency-fields__select">
            <select value={ option } >{
                currencies.map(currency => <option value={ currency[0][1] }>{ currency[0][0] }</option>)
            }</select>
            <div>
                <svg>
                    <use xlinkHref="#arrow-down"></use>
                </svg>
            </div>
        </div>
    )
}

export default Select;
